pragma solidity 0.8.7;
import "../lib/Concat.sol";

library RevertMsg {
    using Concat for string;
    function ToString(bytes memory _returnData) internal pure returns (string memory) {
        // If the _res length is less than 68, then the transaction failed silently (without a revert message)
        if (_returnData.length < 68) return "";

        assembly {
            // Slice the sighash.
            _returnData := add(_returnData, 0x04)
        }
        return abi.decode(_returnData, (string)); // All that remains is the revert string
    }
}","keccak256":"0x38c8bdee92e0082da81d7e9c853815000b1f03f15c2d2684078252d7feb15af3","license":"GPL-3.0"}},"version":1}
